import React from 'react';
import ReactDOM from 'react-dom/client';
import Mercedes from './Car.js';


const root = ReactDOM.createRoot(document.getElementById('root'));

const addChild = (a) => {
  alert(a);
}
const element = <button onClick={addChild("shahzaib")}>Click me!</button>;

root.render(element);
